/* eslint-disable react-hooks/exhaustive-deps */
/* eslint-disable no-unused-vars */
import React, {useEffect, useState } from 'react'
import { Paper, makeStyles, Grid, TableBody, TableRow, TableCell, Badge, ButtonGroup } from '@material-ui/core';
import * as adminService from "../../../services/adminService";
import Popup from "../../../components/Popup";
import TransferForm from './TransferForm';
import useTableAdmin from '../../../components/useTableAdmin';
import Header from '../../../components/Header'
import Controls from '../../../components/controls/Controls';
import { Add, AddOutlined, EditOutlined, Remove, ShoppingCart } from '@material-ui/icons';

const useStyles = makeStyles(theme => ({
    pageContent: {
        margin: theme.spacing(1),
        padding: theme.spacing(1), 
        
    },
    searchInput: {
        width: '50px',
        right:'2px',
    },
    qty: {
        width: '20%',
    },
}))


const headCells = [
    { id: 'waybill', label: 'WayBill' },
    { id: 'materialName', label: 'Material Name' },
    { id: 'referenceMaterial', label: 'Reference Material' },
    { id: 'quantity', label: 'Quantity Material' },
    { id: 'actions', label: 'Action', disableSorting: true }
]

export default function Transfer() {

    const classes = useStyles();
    const [recordForEdit, setRecordForEdit] = useState(null)
    const [records, setRecords] = useState([]);
    const [currentUser, setCurrentUser] = useState(adminService.getCurrentUser());

    const getAlladmin = () => {
        (currentUser ? (currentUser.roles.toString() === "ROLE_ZONE") ? 
        (adminService.getAllLocal(currentUser.eglise)) : (adminService.getAllZone(currentUser.eglise)) : (adminService.getAllZone(currentUser.eglise)))
        .then((res) => {
            setRecords(res.data)
        });
    }
    
    useEffect(() => {
        getAlladmin();
    }, []);

    const [filterFn, setFilterFn] = useState({ fn: records => { return records; } })
    const [openPopup, setOpenPopup] = useState(false)
    // const [notify, setNotify] = useState({ isOpen: false, message: '', type: '' })
    // const [confirmDialog, setConfirmDialog] = useState({ isOpen: false, title: '', subTitle: '' })

    const {
        TblContainer,
        TblHead,
        TblPagination,
        recordsAfterPagingAndSorting
    } = useTableAdmin(records, headCells, filterFn);

    const handleSearch = e => {
        let target = e.target;
        setFilterFn({
            fn: records => {
                if (target.value === "")
                    return records;
                else
                    return records.filter(x => x.eglise.toLowerCase().includes(target.value))
            }
        })
    }

    const addOrEdit = (user, resetForm) => {
        // eslint-disable-next-line no-lone-blocks
        {(user.id) ?
            adminService.updateAdmin(user.id, user) :

            console.log(user)
            console.log(user.id)
        }
        if(!user.id) {
            adminService.insertAdmin(user);
            console.log(user)
            console.log(user.id)
        }
        // setNotify({
        //     isOpen: true,
        //     message: 'Submit Successfully',
        //     type: 'success'
        // })
        resetForm()
        setRecordForEdit(null)
        setOpenPopup(false)
        getAlladmin()
    }

    const openInPopup = user => {
        setRecordForEdit(user)
        setOpenPopup(true)
    }

    const [itemCount, setItemCount] = useState(1);

    return (
        <>
            <Header />
            <Grid >
                <Paper className={classes.pageContent}>
                    <div>
                        <TransferForm />
                    </div>
                </Paper>
                <Paper >
                    <TblContainer>
                    <TblHead />
                    <TableBody>
                        <TableRow>
                            <TableCell></TableCell>
                            <TableCell></TableCell>
                            <TableCell></TableCell>
                            <TableCell>
        <ButtonGroup>
          <Controls.Button
            onClick={() => {
              setItemCount(Math.max(itemCount - 1, 0));
            }}
            startIcon={<Remove />}
            size='small'
            style={{backgroundColor: 'rgb(216, 27, 96)'}}
          />
          <Controls.Input
            value={itemCount}
            className={classes.searchInput}
          />
          <Controls.Button
            onClick={() => {
              setItemCount(itemCount + 1);
            }}
            startIcon={<Add />}
            size='small'
            style={{backgroundColor: 'rgb(67, 160, 71)'}}
          />
        </ButtonGroup>
        </TableCell>
                            <TableCell>
                                <Controls.Button
                                    color="rgb(67, 160, 71)"
                                    startIcon={<Add />}
                                    text='Add'
                                />
                            </TableCell>
                        </TableRow>
                    </TableBody>
                </TblContainer>
                </Paper>
            </Grid>
            <Popup
                title="Formulaire Eglise"
                openPopup={openPopup}
                setOpenPopup={setOpenPopup}
            >
                <TransferForm
                    recordForEdit={recordForEdit}
                    addOrEdit={addOrEdit} />
            </Popup>
            {/* <Notification
                notify={notify}
                setNotify={setNotify}
            /> */}
        </>
    )
}
